import React from 'react';
import { Link } from 'react-router-dom';

const Cart = () => {
  return (
    <div className="container">
      <h1>Shopping Cart</h1>
      <div className="card">
        <p>Your cart is empty</p>
        <Link to="/products" className="btn btn-primary">Continue Shopping</Link>
      </div>
    </div>
  );
};

export default Cart;
